import "../styles/GameKeyboard.css"

const Key = (props) => {
    return(
        <div className="keyboardButton"
            onClick={() => {
                props.onPressedKey(props.text)
        }}>
            {props.text}
        </div>
    )
}

const GameKeyboard = (props) => {
    return (
        <div>
            <Key onPressedKey={props.onPressedKey} text={"Q"}/>
            <Key onPressedKey={props.onPressedKey} text={"W"}/>
            <Key onPressedKey={props.onPressedKey} text={"E"}/>
            <Key onPressedKey={props.onPressedKey} text={"R"}/>
            <Key onPressedKey={props.onPressedKey} text={"T"}/>
            <Key onPressedKey={props.onPressedKey} text={"Y"}/>


        </div>
    )
}

export default GameKeyboard
